measurements.description:
Two flowers on two 20.5-cm inflorescences;  
   dorsal sepal green flushed and veined mahogany centrally, fading to yellow, wide white margin; 
   synsepal green, darker green venation;
   crenellated petals green overlaid pink-brown, mahogany central vein;
   pouch pale yellow-green overlaid pink-brown; 
   staminode yellow-green, central feature yellow;
	substance firm; texture waxy; pouched scratched in transit.
